import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <a href="https://rowanmorrisons.com/" target="_blank" rel="noopener noreferrer">
          <img src="/Rowan-Morrison-logo-02.png" className="rowan-logo" alt="logo" />
        </a>
      </header>
    </div>
  );
}

export default App;
